import React from 'react'
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

export default function Start() {
  return(
    <>
      <AppBar position="static">
        <Toolbar >
          <Button color="inherit">Войти</Button>
          <Button color="inherit">Зарегистрироваться</Button>
        </Toolbar>
      </AppBar>
      <Container>
        <Grid
          container
          direction="column"
          justify="center"
          alignItems="center"
          style={{height: '100vh'}}
          spacing={10}
        >
          <Grid item>
            <Typography variant="h2" component="h1" style={{ fontWeight: 700}}>Для больших проектов и маленьких задач</Typography>
          </Grid>
          <Grid item>
            <Button href='/auth' size="large" variant="outlined" style={{ fontWeight: 700}}>Вперед!</Button>
          </Grid>
        </Grid>
      </Container>
    </>
  )
}
